package org.gitor.autodeployoss.entity;/** * 参数对象 * @author : liuwenlong * @date : 2018/6/4 14:23 */public class ParamsPojo {    /**     * oss类型 , 参照 Contans     */    private Integer ossType;    /**     * git 地址     */    private String gitUrl;    /**     * 分支名     */    private String branch;    /**     * 本地存储路径     */    private String localPath;    /**     * oss 地址     */    private String endpoint;    /**     * accessKeyId     */    private String accessKeyId;    /**     * accessKeySecret     */    private String accessKeySecret;    /**     * bucketName     */    private String bucketName;    public Integer getOssType() {        return ossType;    }    public void setOssType(Integer ossType) {        this.ossType = ossType;    }    public String getGitUrl() {        return gitUrl;    }    public void setGitUrl(String gitUrl) {        this.gitUrl = gitUrl;    }    public String getBranch() {        return branch;    }    public void setBranch(String branch) {        this.branch = branch;    }    public String getLocalPath() {        return localPath;    }    public void setLocalPath(String localPath) {        this.localPath = localPath;    }    public String getEndpoint() {        return endpoint;    }    public void setEndpoint(String endpoint) {        this.endpoint = endpoint;    }    public String getAccessKeyId() {        return accessKeyId;    }    public void setAccessKeyId(String accessKeyId) {        this.accessKeyId = accessKeyId;    }    public String getAccessKeySecret() {        return accessKeySecret;    }    public void setAccessKeySecret(String accessKeySecret) {        this.accessKeySecret = accessKeySecret;    }    public String getBucketName() {        return bucketName;    }    public void setBucketName(String bucketName) {        this.bucketName = bucketName;    }}